// TicketChart.jsx
import React from 'react';
import {
  LineChart,
  Line,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
} from 'recharts';

const TicketChart = () => {
  const data = [
    { month: 'Jan', tickets: 300 },
    { month: 'Feb', tickets: 500 },
    { month: 'Mar', tickets: 800 },
    { month: 'Apr', tickets: 1500 },
    { month: 'May', tickets: 1000 },
    { month: 'Jun', tickets: 1100 },
    { month: 'Jul', tickets: 600 },
    { month: 'Aug', tickets: 700 },
    { month: 'Sep', tickets: 1200 },
    { month: 'Oct', tickets: 900 },
    { month: 'Nov', tickets: 1000 },
    { month: 'Dec', tickets: 950 },
  ];

  return (
    <div className="bg-white dark:bg-gray-800 p-6 rounded-xl shadow-sm mb-6">
      <h2 className="text-lg font-bold mb-2">Estimated of Solved Tickets</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={data}>
          <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
          <XAxis dataKey="month" />
          <YAxis />
          <Tooltip />
          <Line type="monotone" dataKey="tickets" stroke="#10b981" strokeWidth={3} dot />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
};

export default TicketChart;
